package com.ifi.tp;

import com.ifi.tp.bo.Pokemon;
import com.ifi.tp.bo.Trainer;
import com.ifi.tp.repository.TrainerRepository;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.boot.CommandLineRunner;
import org.springframework.boot.SpringApplication;
import org.springframework.boot.autoconfigure.SpringBootApplication;
import org.springframework.context.annotation.Bean;

import java.util.List;

@SpringBootApplication
public class TrainerApi {

    public static void main(String... args){
        SpringApplication.run(TrainerApi.class, args);
    }

    @Bean
    @Autowired
    public CommandLineRunner demo(
            TrainerRepository repository) {
        return (args) -> {

            var ash = new Trainer();
            ash.setName("Ash");
            ash.setPicture(" data:image/png;base64,");

            var pikachu = new Pokemon();
            pikachu.setPokemonNumber(25);
            pikachu.setLevel(18);
            pikachu.setHp(35);

            ash.setTeam(List.of(pikachu));

            var misty = new Trainer();
            misty.setName("Misty");
            misty.setPicture(" data:image/png;base64,");

            var staryu = new Pokemon();
            staryu.setPokemonNumber(120);
            staryu.setLevel(18);
            staryu.setHp(30);
            var starmie = new Pokemon();
            starmie.setPokemonNumber(121);
            starmie.setLevel(21);
            starmie.setHp(45);

            misty.setTeam(List.of(staryu, starmie));

            // save a couple of trainers
            repository.save(ash);
            repository.save(misty);
        };
    }

}
